    false,nt"url": null,nt"notes": "NCEI Accession 0109903 includes discrete
    sample and profile data collected from NOAA Ship RONALD H. BROWN in the North Pacific
    Ocean, South Pacific Ocean and Southern Oceans (> 60 degrees South) from 2007-12-15
    to 2008-02-23. These data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12
    (CFC-12), CHLOROPHYLL A, Carbon tetrachloride (CCL4), Chromophoric Dissolved Organic
    Matter (CDOM), DELTA CARBON-13, DELTA HELIUM-3, DISSOLVED INORGANIC CARBON (DIC),
    DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NEON,
    NITRATE, NITRITE, Partial pressure (or fugacity) of carbon dioxide - water, Potential
    temperature (theta), SALINITY, SULFUR HEXAFLUORIDE (SF6), TOTAL ALKALINITY (TA),
    Total Dissolved Nitrogen (TDN), Tritium (Hydrogen isotope), WATER TEMPERATURE, pH,
    phosphate and silicate. The instruments used to collect these data include Alkalinity
    titrator, CTD, Carbon dioxide (CO2) gas analyzer, Coulometer for DIC measurement,
    Flask with closed headspace for discrete carbon dioxide (CO2) measurement, bottle
    and spectrophotometer.nnThese data were collected by Frank J. Millero and Dennis
    Hansell of Rosenstiel School of Marine and Atmospheric Science, Rik Wanninkhof of
    US DOC; NOAA; OAR; Atlantic Oceanographic and Meteorological Laboratory and Christopher
    Sabine and Richard A. Feely of US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory
    as part of the CLIVAR_P18_2007 data set. CDIAC associated the following cruise ID(s)
    with this data set: CLIVAR_P18_2007nnThe International CLIVAR Global Ocean Carbon
    and Repeat Hydrography Program carries out a systematic and global re-occupation
    of select WOCE/JGOFS hydrographic sections to quantify changes in storage and transport
    of heat, fresh water, carbon dioxide (CO2), and related parameters.",nt"owner_org":
